Handles single gate up to 6 ft long;
- Operator is in strong aluminum housing; 
- Stroke 12" (300 mm); 
- Opening up to 120°; 
- Manual release wit key; 
- Extremely quiet; 
- Stainless steel rod with dust wiper; 
- Mechanical parts lubricated with lithium grease against corrosion, oxidation and rust; 
- Quick installation with multi-position mounting brackets with techno-polymer covers; 
- Sensitivity sensor;
